import React, { Fragment } from "react";
import './home.scss'

function getScrollSwip() {
  window.scroll((res) => {
    console.log(res)
  })
}

export function Home() {
  return (
    <Fragment>
      <div className="index">
        <div className="header-sep"></div>
        <div className="component1">home</div>
        <div className="component2">asd</div>
        <div className="component3">asd</div>
        <div className="component4">asd</div>
      </div>
    </Fragment>
  );
}
